import Carousel from "react-bootstrap/Carousel";
import styled from "styled-components";

const StyledPicture = styled.div`
  width: 400px;
  height: 400px;
  background-color: black;
  display: flex;
  justify-content: center;
  align-items: center;
  color: white;
  font-size: 24px;
  font-weight: bold;
  text-align: center;
`;

const StyledDiv = styled.div`
  height: 30rem;
  width: auto;
  background-color: #edcac4;
`;

const StyledItem = styled(Carousel.Item)`
  display: flex;
  justify-content: center;
  align-items: center;
`;

function HomePage() {
  return (
    <StyledDiv>
      <Carousel>
        <StyledItem>
          <StyledPicture>First Item</StyledPicture>
          <Carousel.Caption>
            <h3>First slide label</h3>
            <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
          </Carousel.Caption>
        </StyledItem>
        <Carousel.Item>
          <StyledPicture>Second Item</StyledPicture>
          <Carousel.Caption>
            <h3>Second slide label</h3>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <StyledPicture>Third Item</StyledPicture>
          <Carousel.Caption>
            <h3>Third slide label</h3>
            <p>
              Praesent commodo cursus magna, vel scelerisque nisl consectetur.
            </p>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
    </StyledDiv>
  );
}

export default HomePage;
